$$\frac{\partial q}{\partial u} 
\frac{\partial u}{\partial x} dx +
\frac{\partial q}{\partial v} 
\frac{\partial v}{\partial y} dy$$

$$\left ( \frac{\partial q}{\partial x} 
\frac{\partial x}{\partial u} + 
\frac{\partial q}{\partial y} 
\frac{\partial y}{\partial u} \right ) du +
\left ( \frac{\partial q}{\partial x} 
\frac{\partial x}{\partial v} + 
\frac{\partial q}{\partial y} 
\frac{\partial y}{\partial v} \right ) dv$$

$$\frac{\partial t}{\partial x}
\frac{\partial x}{\partial w}+
\frac{\partial t}{\partial y}
\frac{\partial y}{\partial w}$$

$$\frac{\partial t}{\partial w}
\frac{\partial w}{\partial x}+
\frac{\partial t}{\partial w}
\frac{\partial w}{\partial y}+
\frac{\partial t}{\partial w}
\frac{\partial w}{\partial z}$$

$$\frac{\partial t}{\partial u}
\frac{\partial u}{\partial x}+
\frac{\partial t}{\partial v}
\frac{\partial v}{\partial y}+
\frac{\partial t}{\partial w}
\frac{\partial w}{\partial z}$$

$$\frac{\partial t}{\partial x}
\frac{\partial x}{\partial u}+
\frac{\partial t}{\partial y}
\frac{\partial y}{\partial u}$$

$$\left ( \frac{\partial p}{\partial x} 
\frac{\partial x}{\partial u} + 
\frac{\partial p}{\partial y} 
\frac{\partial y}{\partial u} +
\frac{\partial p}{\partial z} 
\frac{\partial z}{\partial u} \right ) du +
\left ( \frac{\partial p}{\partial x} 
\frac{\partial x}{\partial v} + 
\frac{\partial p}{\partial y} 
\frac{\partial y}{\partial v} +
\frac{\partial p}{\partial z} 
\frac{\partial z}{\partial v} \right ) dv$$

$$\frac{\partial p}{\partial u} 
\frac{\partial u}{\partial x} dx +
\frac{\partial p}{\partial v} 
\frac{\partial v}{\partial y} dy +
\frac{\partial p}{\partial u} 
\frac{\partial u}{\partial z} dz$$

$$\left ( \frac{\partial z}{\partial x} 
\frac{\partial x}{\partial u} + 
\frac{\partial z}{\partial y} 
\frac{\partial y}{\partial u} \right ) du +
\left ( \frac{\partial z}{\partial x} 
\frac{\partial x}{\partial v} + 
\frac{\partial z}{\partial y} 
\frac{\partial y}{\partial v} \right ) dv$$

$$\left ( \frac{\partial z}{\partial x} 
\frac{\partial x}{\partial u} + 
\frac{\partial z}{\partial y} 
\frac{\partial y}{\partial u} \right ) dx +
\left ( \frac{\partial z}{\partial x} 
\frac{\partial x}{\partial v} + 
\frac{\partial z}{\partial y} 
\frac{\partial y}{\partial v} \right ) dy$$

$$\frac{\partial p}{\partial u}
\frac{\partial u}{\partial x}+
\frac{\partial p}{\partial v}
\frac{\partial v}{\partial y}$$

$$\frac{\partial p}{\partial x}
\frac{\partial x}{\partial v}+
\frac{\partial p}{\partial y}
\frac{\partial y}{\partial v}+
\frac{\partial p}{\partial z}
\frac{\partial z}{\partial v}$$

$$\frac{\partial p}{\partial v}
\frac{\partial v}{\partial x}+
\frac{\partial p}{\partial v}
\frac{\partial v}{\partial y}+
\frac{\partial p}{\partial v}
\frac{\partial v}{\partial z}$$

$$\frac{\partial p}{\partial x}
\frac{\partial x}{\partial u}+
\frac{\partial p}{\partial y}
\frac{\partial y}{\partial u}+
\frac{\partial p}{\partial z}
\frac{\partial z}{\partial u}$$
